import './MyDate.css'


const MyDate = (props) => {
    console.log('this is MyDate.js' + props.date)
    return  <div className="date">
                <div className="month">{props.date.toLocaleString('en-SG')}</div>
                <div className="day">{props.date.getDate()}</div>
            </div>        
};

export default MyDate;
